import firebase from 'firebase'

// Initialize Firebase
var config = {
    apiKey: "AIzaSyAUBTOFwL44i5RSgaUkTc2h74AAUaZXbvU",
    authDomain: "kanban-example.firebaseapp.com",
    databaseURL: "https://kanban-example.firebaseio.com",
    projectId: "kanban-example",
    storageBucket: "kanban-example.appspot.com",
    messagingSenderId: "464092018431"
};
firebase.initializeApp(config);

const db = firebase.database()

export default db
